import React from "react";
import { Link } from "react-router-dom";

const CreateButton = () => {
  return (
    <React.Fragment>
      <Link to={this.props.link} className="btn btn-lg btn-info">
        Create a {this.props.caption}
      </Link>
    </React.Fragment>
  );
};

export default CreateButton;
